import{_ as A,c as f,o as P,a as r}from"./app-D16NT2N0.js";const v={},a=r('<h1 id="_2024ospp-kde项目中期总结" tabindex="-1"><a class="header-anchor" href="#_2024ospp-kde项目中期总结"><span>2024OSPP KDE项目中期总结</span></a></h1><p>OSPP项目开始已经过去三周了，三周过去，我的项目已经取得了一定的进展。</p><h2 id="第一周-7月1号——7月7号" tabindex="-1"><a class="header-anchor" href="#第一周-7月1号——7月7号"><span>第一周 7月1号——7月7号</span></a></h2><p>在项目的第一周，在导师的帮助下，我首先配置好了一个合适的开发环境，并确定了项目的首先迁移的应用为Blinken。除此之外，也搭建这个项目博客，目前博客已经被KDE planet收录。</p><p>目前使用的开发环境在一台Fedora workstation 40 的Virtual Box虚拟机上，在这台虚拟机上我可以编译构建KDE应用，并进行Qt开发。</p><p>构建KDE开发环境推荐使用KDE官方提供的<a href="https://develop.kde.org/docs/getting-started/building/kdesrc-build-setup/" target="_blank" rel="noopener noreferrer">kdesrc-build</a>，同时也推荐在KDE的Neon系统下进行开发，可以选择使用<a href="https://community.kde.org/Get_Involved/development/More#Develop_in_a_Linux_container" target="_blank" rel="noopener noreferrer">docker</a> 或者<a href="https://community.kde.org/Get_Involved/development/Developing_in_a_virtual_machine" target="_blank" rel="noopener noreferrer">虚拟机</a></p><p>构建Qt安卓开发环境比较简单的方法是使用[Qt Online Installer](<a href="https://doc.qt.io/qt-6/get-and-install-qt.html#using-qt-maintenance-tool" target="_blank" rel="noopener noreferrer">Get and Install Qt | Qt 6.7</a>)和QtCreator 装好QtCreator之后，在Editing-&gt; Perferences-&gt;devices-&gt; Android 那里可以选择自己需要的开发套件，QtCreator会自动下载需要的Sdk和Ndk。</p><h2 id="第二周-7月8号——7月14号" tabindex="-1"><a class="header-anchor" href="#第二周-7月8号——7月14号"><span>第二周 7月8号——7月14号</span></a></h2><p>在导师的建议下，我开发了一个简单的Tic-Tac-Toe的QML游戏作为练手。 这个游戏使用QML绘制了一个简单的页面，并使用C++class控制游戏逻辑，我即将迁移的游戏也将会是这种架构。</p><p>游戏目前实现的特性有</p><ol><li>多语言本地化支持</li><li>具备单元测试</li><li>可以跨平台运行</li></ol><p>Tic-Tac-Toe游戏目前已经被我放到KDE invent上开源。<a href="https://invent.kde.org/zhy/tictactoe" target="_blank" rel="noopener noreferrer">hanyang zhang / TicTacToe · GitLab</a></p><p>对QML应用做本地化支持需要使用Qt提供的本地化工具lupdate、lrelease等。 但是因为项目使用Cmake构建，Qt也提供了相应的Cmake方法：<a href="https://doc.qt.io/qt-6/qtlinguist-cmake-qt-add-translations.html" target="_blank" rel="noopener noreferrer">qt_add_translations | Qt Linguist Manual</a></p><p>另外，我在构建QML安卓应用时遇到了一些困难，见：</p><h2 id="第三周-7月15号——7月21号" tabindex="-1"><a class="header-anchor" href="#第三周-7月15号——7月21号"><span>第三周 7月15号——7月21号</span></a></h2><p>在这一周我正式开始迁移Blinken的工作。</p><p>在研究了Blinken的源码之后，我发现Blinken的界面是由一个名为Blinken的类绘制的，这个类有1000多行，绘制逻辑一部分为操作Blinken.svg中元素，另外一部分为使用QPainter直接绘制。</p><p>但是遗憾的是，QML中并没有提供如Qtwight那样操作SVG图片的功能，于是我对SVG图片进行了拆分，将所有元素分别单独拆为文件，并用QML将这些元素组装了起来。</p><p><img src="data:image/jpeg;base64," alt="image"></p><p>对UI的修改花费的时间比我想象中的长，不过一周过去，我基本完成了对Blinken界面的绘制，接下来主要是修改一些页面细节，以及将Blinken的逻辑转移过来。</p><p>值得一提的是，QML并未提供非矩形的MouseArea供使用，需要自己写一个类来实现这个功能。不过好在早期版本的文档里提供了一个这样的example<a href="https://code.qt.io/cgit/qt/qtdeclarative.git/tree/examples/quick/customitems/maskedmousearea?h=6.2" target="_blank" rel="noopener noreferrer">maskedmousearea « customitems « quick « examples - qt/qtdeclarative.git - Qt Declarative (Quick 2)</a> 虽然不知道为什么这个例子在最新版本中被删除了，但应该可以参照着实现。</p>',21),t=[a];function e(X,w){return P(),f("div",null,t)}const V=A(v,[["render",e],["__file","2024OSPP KDE项目中期总结.html.vue"]]),H=JSON.parse('{"path":"/zh/posts/2024OSPP%20KDE%E9%A1%B9%E7%9B%AE%E4%B8%AD%E6%9C%9F%E6%80%BB%E7%BB%93.html","title":"2024OSPP KDE项目中期总结","lang":"zh-CN","frontmatter":{"date":"2024-07-21T00:00:00.000Z","category":["OSPP"],"tag":["OSPP","KDE"],"excerpt":"<p>项目进展</p>","head":[["link",{"rel":"alternate","type":"application/atom+xml","href":"https://heeiya.github.io/KDEBlog/zh/atom.xml","title":"Blog Atom Feed"}],["link",{"rel":"alternate","type":"application/json","href":"https://heeiya.github.io/KDEBlog/zh/feed.json","title":"Blog JSON Feed"}],["link",{"rel":"alternate","type":"application/rss+xml","href":"https://heeiya.github.io/KDEBlog/zh/rss.xml","title":"Blog RSS Feed"}]]},"headers":[{"level":2,"title":"第一周 7月1号——7月7号","slug":"第一周-7月1号——7月7号","link":"#第一周-7月1号——7月7号","children":[]},{"level":2,"title":"第二周 7月8号——7月14号","slug":"第二周-7月8号——7月14号","link":"#第二周-7月8号——7月14号","children":[]},{"level":2,"title":"第三周 7月15号——7月21号","slug":"第三周-7月15号——7月21号","link":"#第三周-7月15号——7月21号","children":[]}],"git":{"updatedTime":1721830893000,"contributors":[{"name":"hanyang zhang","email":"hanyangzhang@qq.com","commits":1}]},"filePathRelative":"zh/posts/2024OSPP KDE项目中期总结.md"}');export{V as comp,H as data};
